import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import SignUp from './pages/SignUp';
import './css/home.css';
import Login from './pages/Login';
import Home from './pages/Home';
import Facture from './pages/Facture'
import Showfacture from './pages/Showfacture';
import Voirallfacture from './pages/Voirallfacture';
import Updatefacture from './pages/Updatefacture';
import Updateuser from './pages/Updateuser';
const App = () => {

  return (

    <Router>
      <Routes>
        <Route path="/register" element={<SignUp/>} />
        <Route path="/addfacture/factures" element={<Voirallfacture />} />

        <Route  path="/" element={<Login/>} />


        <Route path="/addfacture" element={<Home/>} />

        <Route path="/facture/:id" element={<Updateuser   />} />

        <Route path="/facture" element={<Facture/>} />
        <Route path="/showfacture" element={<Showfacture/>} />

        <Route path="/addfacture/factures/:id" element={<Updatefacture   />} />

      </Routes>
    </Router>
  );
};

export default App;
